window.bookSummaryJSON = "<p>The community's war is over, but the fight for my future has only just begun.</p> <p>I know what I want, and so does Logan. But wanting and wishing don't guarantee a happy ending. Still, I'm determined to give us a fighting chance in what feels like impossible circumstances.</p> <p>So I join Logan on a trip home, and my eyes are opened to a world of werewolf hierarchy and politics that I didn't see coming.</p> <p>Now, with everyone in his pack convinced that I'm not the right pick for their future alpha, I have to prove my worth.</p> <p>But trying to do that creates consequences that not only affect me but the entire werewolf population. I can only hope that Logan's and my love is strong enough to survive.</p> <p>Because if it's not, everything we've been working for will be over before it's begun.</p> <p>Contains mature themes.</p>"; 
